import React from "react";
import apa from "../../images/logos/apa.png";

const QuoteCard = () => {
  return (
    <div className="single-quote">
      <ul>
        <li>
          <div className="cmpny">
            <div className="logo">{/* <img src={apa} alt="" /> */}</div>
            <div className="text"></div>
          </div>
        </li>
        <li>Price</li>
        <li>Benefits</li>
        <li>Actions</li>
        <li>Compare</li>
      </ul>
    </div>
  );
};

export default QuoteCard;
